import { useState, useEffect} from "react";
import './App.css';
import useAlgo from "./useAlgo"

export default function App() {
    const [results, setResults] = useState([])
    var url = './Food3.json'
    url = './popularpoll.json'
    url = './Heuristic.json'
    useEffect(() => {
      axios
        .get(url)
        .then(res => { 
          setResults(res.data)
        })
        .catch(e => { console.log(e)}) },[])


